import './App.css'

const Header = () =>{
  return ( 
  <nav className='nav-bar'>

  <ul>
  <li>
  <a href='/'> Home</a>
  </li>
  <li>
  <a href="/contact-us">Contact</a></li>
  </ul>
  </nav>
  )
}
const App=()=> {
  return (
    <div>
      <Header />
      <h1>Homepage</h1>
      <p> This a homepage</p>
    </div>

  );
}

export default App;
